import React, { useState } from 'react'
import {Form, Stack} from 'react-bootstrap'
const Search = () => {
  const [keywords, setKeywords] = useState("");
  return (
    <Stack>

      <Form.Control 
        type="text"
        value={keywords}
        onChange={(e)=> setKeywords(e.target.value)}
        placeholder='Enter the email address'
        />
      </Stack>

  )
}

export default Search
